import React, { Component } from "react";

class Header extends Component {
  render() {
    return (
      <div className="abs header">
        <div className="logo">로고</div>
        <div className="menu">
          <div>내 정보</div>
          <div>로그아웃</div>
        </div>
      </div>
    );
  }
}

export default Header;
